ferring a patient within the hospital','b389cd73-e89f-446e-9c2f-2af3e14be8ae',NULL,NULL,NULL,NULL),('emr.transferWithinHospitalForm',NULL,'UUID of the Transfer Form (not required)','f6953135-895d-4888-9009-7b6dd2434234',NULL,NULL,NULL,NULL),('emr.unknownLocation',NULL,'UUID of the Location that represents an Unknown Location','a3feb5bb-9207-454f-8d7b-0c0f1e7cac97',NULL,NULL,NULL,NULL),('emr.unknownProvider','f9badd80-ab76-11e2-9e96-0800200c9a66','UUID of the Provider that represents an Unknown Provider','ecb5542a-6965-4d4b-878d-53b9a311dc91',NULL,NULL,NULL,NULL),('emr.visitNoteEncounterType',NULL,'UUID of the encounter type for a visit note','5da8f597-032f-4c2c-b0db-afb78eb0a883',NULL,NULL,NULL,NULL),('emrapi.lastViewedPatientSizeLimit','50','Specifies the system wide number of patients to store as last viewed for a single user,\r\n            defaults to 50 if not specified','b24e653b-b446-485b-b7ad-85cdd075a820',NULL,NULL,NULL,NULL),('emrapi.mandatory','false','true/false whether or not the emrapi module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','399491f2-9008-4314-ae23-87d9df09b61d',NULL,NULL,NULL,NULL),('emrapi.nonDiagnosisConceptSets',NULL,'UUIDs or mapping of non diagnosis concept sets','4676872c-aa98-46f5-a3c7-3badae8abe7d',NULL,NULL,NULL,NULL),('emrapi.sqlGet.wardsListDetails','SELECT\r\n  b.bed_number AS \'Bed\',\r\n  concat(pn.given_name, \' \', pn.family_name) AS \'Name\',\r\n  pv.uuid AS \'Patient Uuid\',\r\n  pi.identifier AS \'Id\',\r\n  pv.gender AS \'Gender\',\r\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS \'Age\',\r\n  pa.county_district AS \'District\',\r\n  pa.city_village AS \'Village\',\r\n  admission_provider_name.given_name AS \'Admission By\',\r\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Admission Time\',\r\n  diagnosis.diagnosisConcept AS \'Diagnosis\',\r\n  diagnosis.certainty AS \'Diagnosis Certainty\',\r\n  diagnosis.diagnosisOrder AS \'Diagnosis Order\',\r\n  diagnosis.status AS \'Diagnosis Status\',\r\n  diagnosis.diagnosis_provider AS \'Diagnosis Provider\',\r\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \'%d %b %y %h:%i %p\') AS\r\n       CHAR) AS \'Diagnosis Datetime\',\r\n  dispositionInfo.providerName AS \'Disposition By\',\r\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Disposition Time\',\r\n  adtNotes.value_text AS \'ADT Notes\',\r\n  v.uuid AS \'Visit Uuid\'\r\nFROM bed_location_map blm\r\n  INNER JOIN bed b\r\n    ON blm.bed_id = b.bed_id AND\r\n       b.status = \'OCCUPIED\' AND\r\n       blm.location_id IN (SELECT child_location.location_id\r\n                           FROM location child_location JOIN\r\n                             location parent_location\r\n                               ON parent_location.location_id =\r\n                                  child_location.parent_location\r\n                           WHERE\r\n                             parent_location.name = ${location_name})\r\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\r\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\r\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\r\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\r\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n  INNER JOIN global_property gp on gp.property=\'emr.primaryIdentifierType\' and gp.property_value=pit.uuid\r\n  LEFT JOIN person_address pa ON pa.person_id = pv.person_id\r\n  INNER JOIN (SELECT\r\n                patient_id,\r\n                max(encounter_datetime) AS max_encounter_datetime,\r\n                max(visit_id) as visit_id,\r\n                max(encounter_id) AS encounter_id\r\n              FROM encounter\r\n                INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\r\n              WHERE encounter_type.name = \'ADMISSION\'\r\n              GROUP BY patient_id) latestAdmissionEncounter ON pv.person_id = latestAdmissionEncounter.patient_id\r\n  INNER JOIN visit v ON latestAdmissionEncounter.visit_id = v.visit_id\r\n  LEFT OUTER JOIN obs adtNotes\r\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id AND adtNotes.voided = 0 AND\r\n       adtNotes.concept_id = (SELECT concept_id\r\n                              FROM concept_name\r\n                              WHERE name = \'Adt Notes\' AND concept_name_type = \'FULLY_SPECIFIED\')\r\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\r\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\r\n  LEFT OUTER JOIN person_name admission_provider_name\r\n    ON admission_provider_name.person_id = admission_provider.person_id\r\n  LEFT OUTER JOIN (\r\n                    SELECT\r\n                      bpam.patient_id AS person_id,\r\n                      concept_name.name AS disposition,\r\n                      latestDisposition.obs_datetime AS providerDate,\r\n                      person_name.given_name AS providerName\r\n                    FROM bed_patient_assignment_map bpam\r\n                      INNER JOIN (SELECT\r\n                                    person_id,\r\n                                    max(obs_id) obs_id\r\n                                  FROM obs\r\n                                  WHERE concept_id = (SELECT concept_id\r\n                                                      FROM concept_name\r\n                                                      WHERE\r\n                                                        name = \'Disposition\' AND concept_name_type = \'FULLY_SPECIFIED\')\r\n                                  GROUP BY person_id) maxObsId ON maxObsId.person_id = bpam.patient_id\r\n                      INNER JOIN obs latestDisposition\r\n                        ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\r\n                      INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\r\n                                                 concept_name_type = \'FULLY_SPECIFIED\'\r\n                      LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\r\n                      LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\r\n                      LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\r\n                    WHERE bpam.date_stopped IS NULL\r\n                  ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\r\n  LEFT OUTER JOIN (\r\n                    SELECT\r\n                      diagnosis.person_id AS person_id,\r\n                      diagnosis.obs_id AS obs_id,\r\n                      diagnosis.obs_datetime AS diagnosis_datetime,\r\n                      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name,\r\n                         diagnosis.value_text) AS diagnosisConcept,\r\n                      certaintyConceptName.name AS certainty,\r\n                      diagnosisOrderConceptName.name AS diagnosisOrder,\r\n                      diagnosisStatusConceptName.name AS status,\r\n                      person_name.given_name AS diagnosis_provider\r\n                    FROM bed_patient_assignment_map bpam\r\n                      INNER JOIN visit latestVisit\r\n                        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL AND\r\n                           bpam.date_stopped IS NULL\r\n                      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\r\n                      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\r\n                                                  diagnosis.encounter_id = encounter.encounter_id AND\r\n                                                  diagnosis.concept_id IN (SELECT concept_id\r\n                                                                           FROM concept_name\r\n                                                                           WHERE name IN\r\n                                                                                 (\'Coded Diagnosis\', \'Non-Coded Diagnosis\')\r\n                                                                                 AND\r\n                                                                                 concept_name_type = \'FULLY_SPECIFIED\')\r\n                      LEFT OUTER JOIN concept_name diagnosisConceptName\r\n                        ON diagnosis.value_coded IS NOT NULL AND diagnosis.value_coded = diagnosisConceptName.concept_id\r\n                           AND diagnosisConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n                      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\r\n                      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\r\n                      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\r\n                      INNER JOIN obs certainty\r\n                        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0 AND\r\n                           certainty.concept_id = (SELECT concept_id\r\n                                                   FROM concept_name\r\n                                                   WHERE name = \'Diagnosis Certainty\' AND\r\n                                                         concept_name_type = \'FULLY_SPECIFIED\')\r\n                      LEFT OUTER JOIN concept_name certaintyConceptName\r\n                        ON certainty.value_coded IS NOT NULL AND certainty.value_coded = certaintyConceptName.concept_id\r\n                           AND certaintyConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n                      INNER JOIN obs diagnosisOrder\r\n                        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0 AND\r\n                           diagnosisOrder.concept_id = (SELECT concept_id\r\n                                                        FROM concept_name\r\n                                                        WHERE name = \'Diagnosis order\' AND\r\n                                                              concept_name_type = \'FULLY_SPECIFIED\')\r\n                      LEFT OUTER JOIN concept_name diagnosisOrderConceptName ON diagnosisOrder.value_coded IS NOT NULL\r\n                                                                                AND diagnosisOrder.value_coded =\r\n                                                                                    diagnosisOrderConceptName.concept_id\r\n                                                                                AND\r\n                                                                                diagnosisOrderConceptName.concept_name_type\r\n                                                                                = \'FULLY_SPECIFIED\'\r\n                      LEFT JOIN obs diagnosisStatus\r\n                        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0 AND\r\n                           diagnosisStatus.concept_id = (SELECT concept_id\r\n                                                         FROM concept_name\r\n                                                         WHERE name = \'Bahmni Diagnosis Status\' AND\r\n                                                               concept_name_type = \'FULLY_SPECIFIED\')\r\n                      LEFT OUTER JOIN concept_name diagnosisStatusConceptName ON diagnosisStatus.value_coded IS NOT NULL\r\n                                                                                 AND diagnosisStatus.value_coded =\r\n                                                                                     diagnosisStatusConceptName.concept_id\r\n                                                                                 AND\r\n                                                                                 diagnosisStatusConceptName.concept_name_type\r\n                                                                                 = \'FULLY_SPECIFIED\'\r\n                  ) diagnosis ON diagnosis.person_id = pv.person_id','Sql query to get list of wards','9a259148-797f-11e6-b1de-0a59d8bcf6e9',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatients','select distinct\r\nconcat(pn.given_name,\' \', pn.family_name) as name,\r\npi.identifier as identifier,\r\nconcat(\"\",p.uuid) as uuid\r\n        from patient_program ppr\r\n        join person_name pn on ppr.patient_id = pn.person_id and ppr.voided = 0\r\n        join person p on ppr.patient_id=p.person_id\r\n        join patient_identifier pi on ppr.patient_id = pi.patient_id\r\n			where date_completed is null;','Sql query to get list of active patients','2e0577f1-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatientsByProvider','select distinct concat(pn.given_name,\" \", pn.family_name) as name,\r\n  pi.identifier as identifier,\r\n  concat(\"\",p.uuid) as uuid,\r\n  concat(\"\",v.uuid) as activeVisitUuid,\r\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n  from\r\n    visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 and v.voided=0\r\n    join patient_identifier pi on v.patient_id = pi.patient_id and pi.voided=0\r\n    join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n    join global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n    join person p on p.person_id = v.patient_id  and p.voided=0\r\n    join encounter en on en.visit_id = v.visit_id and en.voided=0\r\n    join encounter_provider ep on ep.encounter_id = en.encounter_id  and ep.voided=0\r\n    join provider pr on ep.provider_id=pr.provider_id and pr.retired=0\r\n    join person per on pr.person_id=per.person_id and per.voided=0\r\n    join location l on l.uuid=${visit_location_uuid} and l.location_id = v.location_id\r\n    left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id = (\r\n				select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\r\n			)\r\n  where\r\n    v.date_stopped is null and\r\n    pr.uuid=${provider_uuid}\r\n    order by en.encounter_datetime desc','Sql query to get list of active patients by provider uuid','2e05a9c9-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.additionalSearchHandler','cn.name = \'${testName}\'','Sql query to get list of admitted patients','7e397785-e42f-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.admittedPatients','select distinct\r\n          concat(pn.given_name,\" \", pn.family_name) as name,\r\n          pi.identifier as identifier,\r\n          concat(\"\",p.uuid) as uuid,\r\n          concat(\"\",v.uuid) as activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n        join global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n        join person p on v.patient_id = p.person_id\r\n        join visit_attribute va on v.visit_id = va.visit_id and va.value_reference = \"Admitted\" and va.voided = 0\r\n        join visit_attribute_type vat on vat.visit_attribute_type_id = va.attribute_type_id and vat.name = \"Admission Status\"\r\n        join location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\r\n        where v.date_stopped is null AND v.voided = 0','Sql query to get list of admitted patients','2e0608a1-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.awaitingValidation','select distinct\r\nconcat(pn.given_name,\' \', pn.family_name) as name,\r\npi.identifier as identifier,\r\nconcat(\"\",p.uuid) as uuid\r\n        from patient ppr\r\n        join person_name pn on ppr.patient_id = pn.person_id \r\n        join person p on ppr.patient_id=p.person_id\r\n        join patient_identifier pi on ppr.patient_id = pi.patient_id \r\n        where ppr.patient_id in (select patient_id from patient where patient_id not in (select person_id from obs where concept_id in (select concept_id from concept_name where name in (\"FSTG, Date received\",\"FSTG, Date of presentation at 1st stage\"))));','SQL query to get list of active patients by location','06066c0b-a1d9-4158-9695-bb51aaf094e2',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.awaitingValidationFirstStage','SELECT name, identifier, uuid\nFROM (SELECT\n        concat(pn.given_name, \' \', pn.family_name) AS name,\n        pi.identifier                              AS identifier,\n        p.uuid                                     AS uuid,\n        GROUP_CONCAT(DISTINCT (IF(obs_fscn.name = \'FSTG, Date received\' AND latest_encounter.person_id IS NOT NULL , o.value_datetime, NULL)) ORDER BY o.obs_id DESC)      AS \'dateReceived\',\n        GROUP_CONCAT(DISTINCT (IF(obs_fscn.name = \'FSTG, Date of presentation at 1st stage\' AND latest_encounter.person_id IS NOT NULL , o.value_datetime, NULL))\n                     ORDER BY o.obs_id DESC)       AS \'dateOfPresentation\'\n      FROM person p\n        JOIN patient_identifier pi ON p.person_id = pi.patient_id\n        JOIN person_name pn ON p.person_id = pn.person_id\n        JOIN obs o ON p.person_id = o.person_id\n        JOIN concept_name obs_fscn ON o.concept_id = obs_fscn.concept_id AND\n                                      obs_fscn.name IN\n                                      (\'FSTG, Date received\', \'FSTG, Date of presentation at 1st stage\')\n                                      AND obs_fscn.voided IS FALSE AND o.voided IS FALSE\n        JOIN encounter e ON o.encounter_id = e.encounter_id\n        JOIN (SELECT\n                person_id,\n                obs.concept_id,\n                max(encounter_datetime) AS max_encounter_datetime\n              FROM obs\n                JOIN encounter ON obs.encounter_id = encounter.encounter_id AND obs.voided = FALSE\n                AND encounter.visit_id IN (SELECT max(visit_id) AS latest_visit_id\n                                                         FROM visit GROUP BY patient_id )\n              GROUP BY obs.person_id, obs.concept_id) latest_encounter\n          ON o.person_id = latest_encounter.person_id AND o.concept_id = latest_encounter.concept_id AND\n             e.encounter_datetime = latest_encounter.max_encounter_datetime\n      GROUP BY p.person_id) result\nWHERE (dateReceived IS NOT NULL) AND (dateOfPresentation IS NULL)','awaiting Validation FirstStage','3f33956e-8bb0-11e6-bbb6-0a45d3d0eda9',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.awaitingValidationFollowup','SELECT name, identifier, uuid\nFROM (SELECT\n        concat(pn.given_name, \' \', pn.family_name) AS name,\n        pi.identifier                              AS identifier,\n        p.uuid                                     AS uuid,\n        GROUP_CONCAT(DISTINCT (IF(obs_fscn.name = \'FUP, Date of presentation at Followup\' AND latest_encounter.person_id IS NOT NULL , o.value_datetime, NULL))\n                     ORDER BY o.obs_id DESC)       AS \'dateOfPresentation\'\n      FROM person p\n        JOIN patient_identifier pi ON p.person_id = pi.patient_id\n        JOIN person_name pn ON p.person_id = pn.person_id\n        JOIN obs o ON p.person_id = o.person_id\n        JOIN concept_name obs_fscn ON o.concept_id = obs_fscn.concept_id AND\n                                      obs_fscn.name IN\n                                      (\'FUP, Date of presentation at Followup\')\n                                      AND obs_fscn.voided IS FALSE AND o.voided IS FALSE\n        JOIN encounter e ON o.encounter_id = e.encounter_id AND e.voided is FALSE\n        LEFT JOIN (SELECT\n                     en.visit_id,\n                       person_id,\n                     obs.concept_id,\n                     max(en.encounter_datetime) AS max_encounter_datetime\n                   FROM obs\n                     JOIN encounter en ON obs.encounter_id = en.encounter_id\n                   AND en.visit_id IN (SELECT max(visit_id) AS latest_visit_id\n                                         FROM visit GROUP BY patient_id )\n                   GROUP BY obs.person_id, obs.concept_id) latest_encounter\n          ON o.person_id = latest_encounter.person_id AND o.concept_id = latest_encounter.concept_id\n             AND latest_encounter.max_encounter_datetime = e.encounter_datetime\n        JOIN patient_program pp ON p.person_id = pp.patient_id\n        JOIN program_workflow pw ON pw.program_id = pp.program_id\n        JOIN program_workflow_state pws ON pw.program_workflow_id = pws.program_workflow_id\n        JOIN patient_state ps ON pws.program_workflow_state_id = ps.state AND ps.patient_program_id = pp.patient_program_id\n                                 AND pws.concept_id = (SELECT concept_id FROM concept_name WHERE name = \'Validation\' AND concept_name_type = \'FULLY_SPECIFIED\')\n      GROUP BY p.person_id) result\nWHERE (dateOfPresentation IS NULL)','awaiting Validation Followup','3f3ef409-8bb0-11e6-bbb6-0a45d3d0eda9',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.expectedArrival','SELECT name, identifier, uuid FROM\n  (SELECT concat(pn.given_name,\' \', pn.family_name) as name,\n  pi.identifier as identifier, p.uuid AS uuid,\n  GROUP_CONCAT(DISTINCT(IF(pat.name = \'expectedDateofArrival\', pa.value, NULL))) AS \'Expected Date of Arrival\',\n  GROUP_CONCAT(DISTINCT(IF(pat.name = \'dateofArrival\', pa.value, NULL))) AS \'Date of Arrival\' FROM person p\n  JOIN patient_identifier pi ON p.person_id = pi.patient_id\n  JOIN person_name pn ON p.person_id = pn.person_id and pi.voided=0\n  JOIN person_attribute pa ON p.person_id = pa.person_id\n  JOIN person_attribute_type pat ON pa.person_attribute_type_id = pat.person_attribute_type_id and pa.voided=0\n  GROUP BY p.person_id) result WHERE (result.`Expected Date of Arrival` IS NOT NULL) AND (result.`Date of Arrival` IS NULL)','Expected Arrival Patient Queue','3f3a88d5-8bb0-11e6-bbb6-0a45d3d0eda9',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.highRiskPatients','SELECT DISTINCT\r\n  concat(pn.given_name, \" \", pn.family_name)           AS name,\r\n  pi.identifier                                        AS identifier,\r\n  concat(\"\", p.uuid)                                   AS uuid,\r\n  concat(\"\", v.uuid)                                   AS activeVisitUuid,\r\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") AS hasBeenAdmitted\r\nFROM person p\r\n  INNER JOIN person_name pn ON pn.person_id = p.person_id\r\n  INNER JOIN patient_identifier pi ON pn.person_id = pi.patient_id\r\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n  INNER JOIN global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n  INNER JOIN visit v ON v.patient_id = p.person_id AND v.date_stopped IS NULL AND v.voided = 0\r\n  INNER JOIN (SELECT\r\n                max(test_obs.obs_group_id) AS max_id,\r\n                test_obs.concept_id,\r\n                test_obs.person_id\r\n              FROM obs test_obs\r\n                INNER JOIN concept c ON c.concept_id = test_obs.concept_id AND test_obs.voided = 0\r\n                INNER JOIN concept_name cn\r\n                  ON c.concept_id = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND\r\n                     cn.name IN (${testName})\r\n              GROUP BY test_obs.person_id, test_obs.concept_id) AS tests ON tests.person_id = v.patient_id\r\n  INNER JOIN obs abnormal_obs\r\n    ON abnormal_obs.obs_group_id = tests.max_id AND abnormal_obs.value_coded = 1 AND abnormal_obs.voided = 0\r\n  INNER JOIN concept abnormal_concept ON abnormal_concept.concept_id = abnormal_obs.concept_id\r\n  INNER JOIN concept_name abnormal_concept_name\r\n    ON abnormal_concept.concept_id = abnormal_concept_name.concept_id AND\r\n       abnormal_concept_name.concept_name_type = \"FULLY_SPECIFIED\" AND\r\n       abnormal_concept_name.name IN (\"LAB_ABNORMAL\")\r\n  LEFT OUTER JOIN visit_attribute va ON va.visit_id = v.visit_id AND va.attribute_type_id =\r\n                                                                     (SELECT visit_attribute_type_id\r\n                                                                      FROM visit_attribute_type\r\n                                                                      WHERE name = \"Admission Status\")','SQL QUERY TO get LIST of patients with high risk','2e077663-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsHasPendingOrders','select distinct\r\n          concat(pn.given_name, \" \", pn.family_name) as name,\r\n          pi.identifier as identifier,\r\n          concat(\"\",p.uuid) as uuid,\r\n          concat(\"\",v.uuid) as activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n        join global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n        join person p on p.person_id = v.patient_id\r\n        join orders on orders.patient_id = v.patient_id\r\n        join order_type on orders.order_type_id = order_type.order_type_id and order_type.name != \"Order\" and order_type.name != \"Drug Order\"\r\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id =\r\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\r\n        where v.date_stopped is null AND v.voided = 0 and order_id not in\r\n          (select obs.order_id\r\n            from obs\r\n          where person_id = pn.person_id and order_id = orders.order_id)','Sql query to get list of patients who has pending orders','2e082058-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToAdmit','select distinct concat(pn.given_name,\' \', pn.family_name) as name,\r\n        pi.identifier as identifier,\r\n        concat(\"\",p.uuid) as uuid,\r\n        concat(\"\",v.uuid) as activeVisitUuid\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 AND v.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n        join global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n        join person p on v.patient_id = p.person_id\r\n        join encounter e on v.visit_id = e.visit_id\r\n        join obs o on e.encounter_id = o.encounter_id and o.voided = 0\r\n        join concept c on o.value_coded = c.concept_id\r\n        join concept_name cn on c.concept_id = cn.concept_id\r\n        join location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\r\n        where v.date_stopped is null and cn.name = \'Admit Patient\' and v.visit_id not in (select visit_id\r\n        from encounter ie join encounter_type iet\r\n        on iet.encounter_type_id = ie.encounter_type\r\n        where iet.name = \'ADMISSION\')','Sql query to get list of patients to be admitted','2e05cd71-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToDischarge','SELECT DISTINCT\r\n          concat(pn.given_name, \' \', pn.family_name) AS name,\r\n          pi.identifier AS identifier,\r\n          concat(\"\", p.uuid) AS uuid,\r\n          concat(\"\", v.uuid) AS activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        FROM visit v\r\n        INNER JOIN person_name pn ON v.patient_id = pn.person_id and pn.voided is FALSE\r\n        INNER JOIN patient_identifier pi ON v.patient_id = pi.patient_id and pi.voided is FALSE\r\n        INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n        INNER JOIN global_property gp on gp.property=\"emr.primaryIdentifierType\" and gp.property_value=pit.uuid\r\n        INNER JOIN person p ON v.patient_id = p.person_id\r\n        Inner Join (SELECT DISTINCT v.visit_id\r\n          FROM encounter en\r\n          INNER JOIN visit v ON v.visit_id = en.visit_id AND en.encounter_type =\r\n            (SELECT encounter_type_id\r\n              FROM encounter_type\r\n            WHERE name = \"ADMISSION\")) v1 on v1.visit_id = v.visit_id\r\n        INNER JOIN encounter e ON v.visit_id = e.visit_id\r\n        INNER JOIN obs o ON e.encounter_id = o.encounter_id\r\n        INNER JOIN concept_name cn ON o.value_coded = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND cn.voided is FALSE\r\n        JOIN location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\r\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id =\r\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\r\n        LEFT OUTER JOIN encounter e1 ON e1.visit_id = v.visit_id AND e1.encounter_type = (\r\n          SELECT encounter_type_id\r\n            FROM encounter_type\r\n          WHERE name = \"DISCHARGE\") AND e1.voided is FALSE\r\n        WHERE v.date_stopped IS NULL AND v.voided = 0 AND o.voided = 0 AND cn.name = \"Discharge Patient\" AND e1.encounter_id IS NULL','Sql query to get list of patients to discharge','2e063fce-6444-11e6-8909-080027e15975',NULL,NULL,NULL,NULL),('emrapi.started','true','DO NOT MODIFY. true/false whether or not the emrapi module has been started.  This is used to make sure modules that were running  prior to a restart are started again','59f576f1-da20-4af3-941b-c943621436ca',NULL,NULL,NULL,NULL),('emrapi.suppressedDiagnosisConcepts',NULL,'UUIDs or mappings of suppressed diagnosis concepts','6e027931-83ff-4355-be9d-f0154108b890',NULL,NULL,NULL,NULL),('encounter.feed.publish.url','/openmrs/ws/rest/v1/bahmnicore/bahmniencounter/%s?includeAll=true','Url to be published on encounter save.','f94d5e37-e42d-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL),('encounterForm.obsSortOrder','number','The sort order for the obs listed on the encounter edit form.  \'number\' sorts on the associated numbering from the form schema.  \'weight\' sorts on the order displayed in the form schema.','b19607cb-af06-4af0-8427-0471a20efa43',NULL,NULL,NULL,NULL),('encounterModifier.groovy.allowCaching','true','Allow Groovy Caching','e16605a1-266a-47cb-8385-d07742646640',NULL,NULL,NULL,NULL),('EncounterType.encounterTypes.locked','false','saving, retiring or deleting an Encounter Type is not permitted, if true','98ed3536-c18b-46ba-9498-72a95057aa7b','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('episodes.mandatory','false','true/false whether or not the episodes module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','2293c1ce-